
fn find_missing_number (seq: &[i32]) -> i32 {
    
    let mut seq:Vec<i64> = seq.iter().map(|x| *x as i64).collect();
    seq.sort_by(|a,b| a.cmp(b));

    let n = seq.len();
    let mid = seq[0] + seq[n-1];
    let total = if mid % 2 == 0 { (n + 1) as i64 * (mid / 2) } else { mid * ((n + 1) as i64 / 2) }; 

    (total - seq.iter().sum::<i64>()) as i32
}

